import logo from './logo.svg';
import './App.css';
import React from 'react';
import PizzaForm from './PizzaForm';

//the index page
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <div class="container1">
      <h2>Cult of Personality Pizza</h2>
        <PizzaForm />
      </div>
    </div>
  );
}

export default App;
